import React, { Component } from 'react';

class About extends Component{
    componentWillMount() {
        fetch("http://www.express.com:8989/").then(response => {
            return response.json()
          }).then( data => {
            console.log(data)
          })
    }
    render() {
      return <h3>我们是星际移民公司</h3>
    }
}

export default About;
